import React from 'react'

import I18n from './I18n';

function Home() {
  return (
    <div className="App">
    <div className="App-header">
      <h2><I18n t="homePage.title" /></h2>
      <p><I18n t="homePage.text" /></p>

    </div>
  </div>
  )
}

export default Home
